import React, {Component, Fragment} from 'react';

export class CompleteToDo extends Component {
    constructor(props){
        super(props);
        this.state = {
            todos:[]
        }
    }

    componentDidMount(){
        instance.get('showallcomplete')
        .then(responce => {
            const todos = responce.data;
            this.setState({
                todos
            })
        })
    }
    render(){
        return(
            <Fragment>

            </Fragment>
        )
    }
}

export default CompleteToDo;
